import React from "react";
import { Card } from "react-bootstrap";

const UserList = (props) => {
  const { user } = props;
  return (
    <div>
      {user ? (
        <>
          {user.map((item, index) => {
            return (
              <Card style={{ marginTop: "30px", textAlign: "center" }}>
                {item}
              </Card>
            );
          })}
        </>
      ) : null}
    </div>
  );
};

export default UserList;
